// import logo from './logo.svg';
import "./App.css";

function App() {
  return (
    <article className="Contents">
      <h1>Hamburger App</h1>
      <ol>
        <li>Wake Up at 08:00 </li>
        <li>Clean My room 3h </li>
        <li>Do My homework 3h 20m </li>
        <li>Test comment 2h 1m </li>
        <li>Sleep at 01:00 </li>
      </ol>
    </article>
  );
}

export default App;
